                auto tg_x_yyyy_0 = primBuffer[pidx_g_1_4_m0].data(45 * idx + 10); 

                auto tg_x_yyyz_0 = primBuffer[pidx_g_1_4_m0].data(45 * idx + 11); 

                auto tg_x_yyzz_0 = primBuffer[pidx_g_1_4_m0].data(45 * idx + 12); 

