                auto tg_yyyz_yy_0 = primBuffer[pidx_g_4_2_m0].data(90 * idx + 69); 

                auto tg_yyyz_yz_0 = primBuffer[pidx_g_4_2_m0].data(90 * idx + 70); 

                auto tg_yyyz_zz_0 = primBuffer[pidx_g_4_2_m0].data(90 * idx + 71); 

