                auto tg_y_xxxxxyzz_0 = primBuffer[pidx_g_1_8_m0].data(135 * idx + 53); 

                auto tg_y_xxxxxzzz_0 = primBuffer[pidx_g_1_8_m0].data(135 * idx + 54); 

                auto tg_y_xxxxyyyy_0 = primBuffer[pidx_g_1_8_m0].data(135 * idx + 55); 

                auto tg_y_xxxxyyyz_0 = primBuffer[pidx_g_1_8_m0].data(135 * idx + 56); 

                auto tg_y_xxxxyyzz_0 = primBuffer[pidx_g_1_8_m0].data(135 * idx + 57); 

                auto tg_y_xxxxyzzz_0 = primBuffer[pidx_g_1_8_m0].data(135 * idx + 58); 

                auto tg_y_xxxxzzzz_0 = primBuffer[pidx_g_1_8_m0].data(135 * idx + 59); 

